import './LogoCoin.css';
import logo from './solana-sol-logo.svg';
import menu from './hamburger.svg';

function LogoCoin() {
  return (
    <div>
        <div id="coin">
            <div class="side-a"></div>
            <div class="side-b"></div>
        </div>
        <h1>Click on coin to flip</h1>
    </div>
  );
}

export default LogoCoin;
